import CardMainTitle from "./CardMainTitle";
import CardTitleTag from "./CardTitleTag";
import CardNameTitleText from "./CardNameTitleText";
import "../../styles/card4.css";

const Card4 = (props) => {
  const cardContent = props.cardContent;
  const cardListTag = cardContent?.map((cardText, index) => (
    <CardTitleTag
      key={index}
      img={cardText.img}
      title={cardText.title}
      tag={cardText.tag}
    />
  ));
  const cardVod = props.cardVod;
  const cardListVod = cardVod?.map((cardText, index) => (
    <CardNameTitleText
      key={index}
      img={cardText.img}
      name={cardText.name}
      title={cardText.title}
      text={cardText.text}
    />
  ));

  return (
    <section className="section4li">
      <div>
        <CardMainTitle title={props.title} titleSub={props.titleSub} />
        <ul className="section4li_ul">
          <div>
            <div className="section4li_ul_list">
              <div>
                {cardContent && cardListTag}
                {cardListVod && cardListVod}
              </div>
            </div>
          </div>
        </ul>
      </div>
    </section>
  );
};

export default Card4;
